    str_len = len(str)
    substr_len = len(substr)
    if str_len <= 2 * substr_len:
        return False
    if str[:substr_len] != substr or str[str_len - substr_len:] != substr:
        return False
    return str[:substr_len] == str[str_len - substr_len:][::-1]

